import { Component } from "react";
import "./NavbarStyles.css";

class Navbar extends Component{

    state={clicked: false};

    handleClick = () => {
        this.setState({clicked:!this.state.clicked})
    }

    render(){
        return(
            <>
                <nav>
                    <a href="index.html"><img src="ressources/integration.png" alt="Logo" width="75" left="0"></img></a>
    
                    <div>
                        <ul id="navbar" className={this.state.clicked ? "#navbar active" : "#navbar"}>
                            <li><a href="index.html">Accès</a></li>
                            <li><a href="index.html">Factions</a></li>
                            <li><a href="index.html">Défis</a></li>
                            <li><a href="index.html">Mails</a></li>
                            <li><a href="index.html">Parrainage</a></li>
                            <li><a href="index.html">Events</a></li>
                            <li><a href="index.html">WEI</a></li>
                        </ul>
                    </div>
    
                    <div id="burger" onClick={this.handleClick}>
                        <i id="bar" className={this.state.clicked ? 'fas fa-times' : 'fas fa-bars'}></i>
                    </div>
    
                </nav>
            </>
        )
    }
    
}

export default Navbar;
